DROP TABLE IF EXISTS `product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `product` (
  `product_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `product_code` varchar(50) NOT NULL,
  `product_name` varchar(255) NOT NULL,
  `product_category_id` int(10) unsigned NOT NULL COMMENT 'FK to product sub category',
  `qty_available` int(11) NOT NULL COMMENT 'Quantity available for sale or stock available',
  `qty_uom` varchar(50) NOT NULL DEFAULT 'pc',
  `qty_uom_id` int(11) NOT NULL COMMENT 'FK to qty_uom',
  `acb_cost` float NOT NULL COMMENT 'Adjusted Cost Base (ACB) cost of the product. Cost calculated everytime we purchase the product.',
  `retail_discount_room_percentage` float DEFAULT '10' COMMENT '% discount that customer can get at the product level.  This when applied with markup to the cost results in the sale price',
  `min_ret_gross_profit_margin_percentage` float DEFAULT '40' COMMENT 'Minimum Retail % markup to apply to the ACB to get the sale price. sale price = acb_cost*(1 + min_ret_gross_profit_margin_percentage/100*(1+retail_discount_room_percentage/100))',
  `min_ws_gross_profit_margin_percentage` float DEFAULT '10' COMMENT 'Minimum Wholesale % markup to apply to the ACB to get the sale price. sale price = acb_cost*(1+min_ws_gross_profit_margin_percentage/100)',
  `retail_sale_price` float DEFAULT NULL COMMENT 'The retail sale price of the product.  This overrides the markup and discount_room_percentage applied to cost calculation and EXPLICITLY sets the price at which to sale teh product.',
  `wholesale_sale_price` float DEFAULT NULL,
  `low_stock_alert_qty` int(11) DEFAULT '1' COMMENT 'Min qty before triggers reorder',
  `is_reorder` bit(1) NOT NULL DEFAULT b'1',
  `comments` varchar(255) DEFAULT NULL,
  `updated_on` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_by` varchar(50) NOT NULL,
  PRIMARY KEY (`product_id`),
  UNIQUE KEY `product_code_uk` (`product_code`),
  UNIQUE KEY `product_name_uk` (`product_name`),
  KEY `product_product_category_fk` (`product_category_id`),
  KEY `qty_uom_id_fk` (`qty_uom_id`),
  CONSTRAINT `qty_uom_id_fk` FOREIGN KEY (`qty_uom_id`) REFERENCES `qty_uom` (`qty_uom_id`)
) ENGINE=InnoDB AUTO_INCREMENT=298 DEFAULT CHARSET=utf8;
